import logo from './logo.svg';
import './App.css';

import TitleBar from './components/TitleBar';
import SearchField from './components/UrlInput';
import Summary from './components/Summary';
import Transcript from './components/Transcript';
import TranscriptQuestions from './components/TranscriptQuestions';

function App() {
  return (
    <div className='App'>
      <TitleBar />
      <SearchField />
      <div className='left-pane'>
        <Summary />
      </div>
      <div className='right-pane'>
        <Transcript /> 
        <TranscriptQuestions />
      </div>
    </div>
  );
}

export default App;
